import React from "react";
import Particles from "react-tsparticles";

function Particle() {
    return (
      <Particles
        id="tsparticles"
        params={{
          particles: {
            number: {
              value: 180,
              density: {
                enable: true,
                value_area: 1500,
              },
            },

            line_linked: {
              enable: false,
              opacity: 0.07,
            },
            move: {
              direction: "right",
              speed: 0.3,
            },
            size: {
              value: 1,
            },
            opacity: {
              anim: {
                enable: true,
                speed: 1,
                opacity_min: 0.05,
              },
            },
            color: {
            value: "#000000"
            },
            shape: {
            type: "circle",
            stroke: {
                width: 0,
                color: "#000000"
            },
            polygon: {
                nb_sides: 5
            },
            },
          },
          interactivity: {
            events: {
              onclick: {
                enable: true,
                mode: "push",
              },
            },
            modes: {
              push: {
                particles_nb: 1,
              },
            },
          },
          retina_detect: true,
        }}
      />
    );
  }

  export default Particle;
